fields.technical_characteristic:
синхронна реєстрація 12-ти стандартних відведень;   вбудована система аналізу та інтерпретації;  зберігання в незалежній пам’яті 200 фрагментів ЕКГ по всім 12-ти відведенням з можливістю їх подальшого перегляду та друку;  швидкість розгортки: 5, 12.5, 25, 50, 100 мм/с; 
 вхідний опір > 50 МОм;  цифрові фільтри 50 Гц і 35 Гц;  автоматична компенсація дрейфу ізолінії; 
 придушення синфазних перешкод> 105 дБ;  система контролю якості сигналу;  діапазон вимірювань ЧСС 30 – 300 1/хв;  захист від імпульсів дефібрилятора;  кольоровий сенсорний дисплей роздільною здатністю (800х480 пікселів);  термопринтер;  конфігурація формату виведення ЕКГ на друк;  2.0 USB та Ethernet порт для підключення до ПК і передачі ЕКГ; 
 живлення від мережі 220В, вбудованого акумулятора або бортової мережі автомобіля; 
 автономна робота 3 години (200 роздруківок формата А4);  розміри, мм: 299 x 300 x 123;  вага, кг: 4.

