Функціональні особливості:

TFT екран, сенсорний, розмір 8″;
підключення до центральної системи моніторингу за допомогою Ethernet або Wi-Fi;
перенесення даних моніторингу пацієнта на зовнішній USB накопичувач;
цифрові інтерфейси: USB, Ethernet, HDMI;
