Центральна станція UNET  дозволяє:

приймати, обробляти і візуалізувати в реальному часі хвильові криві і числову інформацію про стан пацієнтів, що надходять від моніторів пацієнта ЮМ 300;
формувати і вести бази даних по всім пацієнтам;
керувати віддалено всіма функціями моніторів, в тому числі, змінювати рівні спрацьовування тривоги і їх пріоритету;
підключити віддалений дисплей;
отримати доступ до інформації з одного монітора на іншому моніторі в мережі;
зберегти в індивідуальному файлі інформацію про пацієнта, дані моніторування та результати обробки;
записати, переглянути, проаналізувати і задокументувати тренди протягом усього часу моніторування пацієнта;
використовувати автоматичне розпізнавання аритмій і збереження 20-секундних відрізків ЕКГ по кожному епізоду порушення ритму;
отримувати автоматичний аналіз порушень ритму по типу аритмій, частотою і часу появи;
отримувати безперервний аналіз зміщення ST-сегмента по всіх відведенням;
безперервно записувати ЕКГ (в індивідуальний файл) протягом 72 годин з подальшим переглядом і розширеним аналізом;
експортувати запис трендів з монітора (за останні 72 годин) і занести їх в БД;
отримати детальний аналіз ЕКГ і оцінку варіабельності ритму серця;
автоматично реєструвати і вести бази даних критичних подій протягом усього часу моніторування пацієнта;
роздрукувати результати моніторування у вигляді таблиць, графіків, фрагментів ЕКГ;
сформувати електронний листа призначень (нагадує про необхідність введення того чи іншого препарату із зазначенням дозування і методу введення, а також проведення тієї чи іншої процедури);
переглядати архів карток пацієнта.

fields.description:
Апарати штучної вентиляції легенів ЮВЕНТ призначені для проведення респіраторної терапії у новонароджених, дітей і дорослих в умовах відділень реанімації та інтенсивної терапії, операційних залах. Інтуїтивно-зрозумілий сенсорний інтерфейс і набір режимів експертного рівня дозволяє проводити штучну вентиляцію легенів в широкому спектрі клінічних ситуацій. Подібне поєднання властивостей дає лікаря унікальні можливості для оцінки його респіраторної підтримки в інтенсивній терапії.

Особливості: 

високоточна пневматична система з активним клапаном видиху;
інтегрована система моніторингу ефективності газообміну і стану механіки дихання;
система безпеки пацієнта з автоматичною адаптацією до умов роботи;
сумісний з будь-яким доступним джерелом медичного кисню – високого (2 – 6 бар) або низького (від 0,2 бар) тиску;
можливість інтеграції апарату в інформаційну систему клініки;
ультразвуковий датчик кисню який не вимагає калібрування і заміни;
технологія UniScreen дає можливість оптимізувати графічний і цифровий моніторинг на кілька дисплеїв, через сенсорний інтерфейс;
універсальна система кріплення VESA, для настінного монтажу апарату або на консолі.

fields.technical_characteristic:
Режими вентиляції:

VCV (S) – вентиляція з керуванням за об’ємом – Assist/Control;
PCV (S) – вентиляція з керуванням по тиску – Assist/Control;
V-SIMV – синхронізованою переміжна вентиляція за об’ємом;
P-SIMV – синхронізованою переміжна вентиляція по тиску;
BiPPV/APRV – вентиляція з двома рівнями PEEP і вивільненням дихальних шляхів від тиску;
CPAP – спонтанне дихання на тлі постійного позитивного тиску;
NIV – неінвазивна вентиляція з підтримкою тиском і тимчасовим циклом/вентиляція IPPV через назальний канюлю для новонароджених;
PS – підтримка самостійного дихання пацієнта тиском;
PCVT – вентиляція з гарантованим об’ємом при мінімально можливому тиску в дихальних шляхах Assist/Control (Volume Guarantee);
PSVT – допоміжна вентиляція з гарантованим об’ємом при мінімально можливому рівні підтримки тиском (Volume Support);
APNEA – вентиляція апное з керуванням по тиску або за об’ємом;
AdVent – інтелектуальна вентиляція з адаптивним алгоритмом досягнення зони респіраторного комфорту і підтримки заданої хвилинної вентиляції;
nCPAP – режим підтримки позитивного тиску в дихальних шляхах через назальний інтерфейс для новонароджених/оксигенотерапія високим потоком для дорослої та педіатричної категорій.

fields.description:
Апарати штучної вентиляції легенів ЮВЕНТ призначені для проведення респіраторної терапії у новонароджених, дітей і дорослих в умовах відділень реанімації та інтенсивної терапії, операційних залах. Інтуїтивно-зрозумілий сенсорний інтерфейс і набір режимів експертного рівня дозволяє проводити штучну вентиляцію легенів в широкому спектрі клінічних ситуацій. Подібне поєднання властивостей дає лікаря унікальні можливості для оцінки його респіраторної підтримки в інтенсивній терапії.

В апараті ЮВЕНТ-T вбудована високопродуктивна турбіна, яка дозволяє здійснювати респіраторну підтримку пацієнта без подачі стислих газів і проводити вентиляцію навколишнім повітрям. Апарат адаптований для роботи з будь-яким доступним джерелом кисню високого тиску – централізоване газопостачання лікарні, балон або кисневий концентратор. 

Особливості:  
високоточна пневматична система з активним клапаном видиху;
інтегрована система моніторингу ефективності газообміну і стану механіки дихання;
система безпеки пацієнта з автоматичною адаптацією до умов роботи;
сумісний з будь-яким доступним джерелом медичного кисню – високого (2 – 6 бар) або низького (від 0,2 бар) тиску;
можливість інтеграції апарату в інформаційну систему клініки;
ультразвуковий датчик кисню який не вимагає калібрування і заміни;
технологія UniScreen дає можливість оптимізувати графічний і цифровий моніторинг на кілька дисплеїв, через сенсорний інтерфейс;
універсальна система кріплення VESA, для настінного монтажу апарату або на консолі.

