Спеціальні функції:

SIGH – періодичне роздування легень з метою профілактики ателектазів;
пауза на вдиху / видиху – для проведення респіраторних маневрів, а також діагностичних процедур;
вбудована система небулізації медикаментозних препаратів;
режим тимчасової подачі кисню з регулюванням підвищення концентрації;
PV-TOOL маневри для діагностичної оцінки стану механіки дихання;
регульована компенсація опору ендотрахеальної трубки;
додатковий канал вимірювання тиску (Pes, Ptr, Pcuff);
одночасне використання тригерів потоку і тиску;
розрахунок вихідних параметрів вентиляції з урахуванням антропометричних даних пацієнта;
режим готовності до роботи зі збереженням установок;
самотестування, з вибором короткого або повного тестів;
визначення та компенсація параметрів підключеного дихального контура;
візуалізація статусу респіраторної підтримки та спонтанної активності пацієнта;
настроювання візуалізації на два дисплеї для оптимізації моніторингу;
волюметрична капнометрія.

fields.description:
Фетальний монітор FC700 – це передпологовий високочутливий ембріональний монітор, який вимірює ембріональний серцевий ритм (FHR) і скорочення матки (UC).

Особливості:
вимірювання серцевого ритму ембріона (FHR), скорочення матки (UC) та рух плода (FM);
автоматичне виявлення руху плода;
світлодіодна індикація показників FHR та UC;
автоматична сигналізація про аномальний FHR.

